import React, { useEffect } from 'react';
import GreetText from './GreetText';
import FAQ from './FAQ';

const Buy = () => {
    useEffect(() => document.title = "Buy Gold")
    return (<>
        <main>
            <div className="container-fluid">
                <div className="row">
                    <div className="col-md-7 col-12">
                        <GreetText greetText="Sell Gold" />
                    </div>
                    <FAQ />
                </div>
            </div>
        </main>
    </>);
}

export default Buy;
